import React from "react";
import "./ProjectShowcase.css";

const projects = [
  { id: 1, title: "Corporate Workspace", image: require("../assets/projects/project1.webp") },
  { id: 2, title: "Creative Studio", image: require("../assets/projects/project2.webp") },
  { id: 3, title: "Modern Office", image: require("../assets/projects/project3.webp") },
];

function ProjectShowcase() {
  return (
    <section className="projects" id="projects">
      <h2>Our Projects</h2>
      <div className="project-grid">
        {projects.map((project) => (
          <div key={project.id} className="project-card">
            <img src={project.image} alt={project.title} />
            <div className="overlay">
              <h3>{project.title}</h3>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default ProjectShowcase;
